import React from "react";
import { useDispatch } from "react-redux";
import clsx from "clsx";
import * as Yup from "yup";
import PropTypes from "prop-types";
import { Formik } from "formik";
import { Box, Button, Checkbox, FormHelperText, TextField, Typography, Link, makeStyles } from "@material-ui/core";
import { register } from "src/actions/accountActions";

const useStyles = makeStyles(() => ({
	root: {},
}));

function RegisterForm({ className, onSubmitSuccess, ...rest }) {
	const classes = useStyles();
	const dispatch = useDispatch();

	return (
		<Formik
			initialValues={{
				// firstName: '',
				// lastName: '',
				name: "jung",
				email: "jung@healthdata.com",
				password: "1111111",
				policy: true,
			}}
			validationSchema={Yup.object().shape({
				// firstName: Yup.string().max(255).required('First name is required'),
				// lastName: Yup.string().max(255).required('Last name is required'),
				name: Yup.string()
					.max(255)
					.required("Name is required"),
				email: Yup.string()
					.email("Must be a valid email")
					.max(255)
					.required("Email is required"),
				password: Yup.string()
					.min(5)
					.max(255)
					.required("Password is required"),
				policy: Yup.boolean().oneOf([true], "This field must be checked"),
			})}
			onSubmit={async (values, { setErrors, setStatus, setSubmitting }) => {
				try {
					await dispatch(register(values));
					onSubmitSuccess();
				} catch (error) {
					setStatus({ success: false });
					setErrors({ submit: error.message });
					setSubmitting(false);
				}
			}}
		>
			{({ errors, handleBlur, handleChange, handleSubmit, isSubmitting, touched, values }) => (
				<form className={clsx(classes.root, className)} onSubmit={handleSubmit} {...rest}>
					{/* <TextField
            error={Boolean(touched.firstName && errors.firstName)}
            fullWidth
            helperText={touched.firstName && errors.firstName}
            label="First Name"
            margin="normal"
            name="firstName"
            onBlur={handleBlur}
            onChange={handleChange}
            type="firstName"
            value={values.firstName}
            variant="outlined"
          />
          <TextField
            error={Boolean(touched.lastName && errors.lastName)}
            fullWidth
            helperText={touched.lastName && errors.lastName}
            label="Last Name"
            margin="normal"
            name="lastName"
            onBlur={handleBlur}
            onChange={handleChange}
            type="lastName"
            value={values.lastName}
            variant="outlined"
          /> */}
					<TextField
						error={Boolean(touched.name && errors.name)}
						fullWidth
						helperText={touched.name && errors.name}
						label="Name"
						margin="normal"
						name="name"
						onBlur={handleBlur}
						onChange={handleChange}
						type="name"
						value={values.name}
						variant="outlined"
					/>
					<TextField
						error={Boolean(touched.email && errors.email)}
						fullWidth
						helperText={touched.email && errors.email}
						label="Email Address"
						margin="normal"
						name="email"
						onBlur={handleBlur}
						onChange={handleChange}
						type="email"
						value={values.email}
						variant="outlined"
					/>
					<TextField
						error={Boolean(touched.password && errors.password)}
						fullWidth
						helperText={touched.password && errors.password}
						label="Password"
						margin="normal"
						name="password"
						onBlur={handleBlur}
						onChange={handleChange}
						type="password"
						value={values.password}
						variant="outlined"
					/>
					{/* <Box
            alignItems="center"
            display="flex"
            mt={2}
            ml={-1}
          >
            <Checkbox
              checked={values.policy}
              name="policy"
              onChange={handleChange}
            />
            <Typography
              variant="body2"
              color="textSecondary"
            >
              I have read the
              {' '}
              <Link
                component="a"
                href="#"
                color="secondary"
              >
                Terms and Conditions
              </Link>
            </Typography>
          </Box> */}
					{Boolean(touched.policy && errors.policy) && <FormHelperText error>{errors.policy}</FormHelperText>}
					<Box mt={2}>
						<Button color="secondary" disabled={isSubmitting} fullWidth size="large" type="submit" variant="contained">
							Create account
						</Button>
					</Box>
				</form>
			)}
		</Formik>
	);
}

RegisterForm.propTypes = {
	className: PropTypes.string,
	onSubmitSuccess: PropTypes.func,
};

RegisterForm.default = {
	onSubmitSuccess: () => {},
};

export default RegisterForm;
